#!/usr/bin/perl -w
sub usage (){
    die qq(
#===========================================================================
#        USAGE:MGI.pl  -h <Gene list>
#        DESCRIPTION: -h : Display this help
#        For given gene list, query the MGI dataset and find relevant phenotype
#        Author: Wang Yu
#        Mail: yulywang\@umich.edu
#        Created Time:  Mon 04 Mar 2019 11:52:58 AM EST
#===========================================================================
)
}
use strict;
use warnings;
use Getopt::Std;
$ARGV[0] || &usage();
our ($opt_h);
getopts("h");

my %hash; # recode human mouse gene name
while(my $line = <DATA>){
	chomp $line;
	my @F = split/\s+/,$line;
	push @{$hash{$F[0]}},$F[1];
}

my %phenotype; #for plain text pheotype
my %isa; # for Go root
open PT, "/home/yulywang/db/MGI/MP_phenotype.lite";
while(my $line = <PT>){
	chomp $line;
	my @F = split/\s+/,$line;
	#print $#F,"\n";
	$phenotype{$F[0]} = $F[1];
	if($#F>=2){
		@{$isa{$F[0]}} = @F[2..$#F];
		#print @F[2..$#F],"\n";
	}
}

open IN, $ARGV[0];
while(my $line = <IN>){
	chomp $line;
	my @F = split/\s+/,$line;
	my $gene = $F[0];
	next if (not exists $hash{$F[0]});
	my @human_gene = @{$hash{$F[0]}};
	foreach my $human_gene(@human_gene){
		#my @MP = `grep -w $human_gene /home/yulywang/db/MGI/Gene_MP| cut -f4 | sort | uniq `;
		my @MP = `grep -w $human_gene /home/yulywang/db/MGI/Other/MGI_PhenoGenoMP.rpt| cut -f4 | sort | uniq `;
		chomp @MP;
		foreach my $MP(@MP){
			print $gene,"\t",$human_gene,"\t",$MP;
			if(exists $phenotype{$MP}){
				print "\t$phenotype{$MP}";
			}
			if(exists $isa{$MP}){
				my @output = @{$isa{$MP}};
				print "\t", join("/",@output);
			}
			print "\n";
		}
	}
}
